The accompanying music video for &quot;Can't Get You Out Of My Head&quot; was directed by Dawn Shadforth. It shows Minogue driving towards a futuristic city and back-up dancers in various futuristic costumes dancing in a highly stylized manner. It then focuses on Minogue in a sporty outfit, after which she is seen with other dancers in a computer-generated futuristic city. Her white, hooded costume, with plunging necklines and revealing slits, was widely discussed both for its fashion style and for Minogue's overt sexual posturing.[citation needed] Lastly, she appears with a curly hairdo in a metal-like costume. In his book La La La, William Baker conceded that the robotic dance within the video was purposely developed to give Minogue an association with a dance the way Madonna had developed an association with Vogueing, he felt that at this stage in her career it was important for Minogue to set trends and not follow them, just as Madonna had before her.

In 2002, the video won the MTV Video Music Award for Best Choreography. It was voted the third best video of all time by viewers of MTV Italy.
